import React, { useEffect, useState} from 'react';
import {Link} from 'react-router-dom';
import Navbar from './Navbar';
import useHttpGet from '../hooks/httpGet';

function Dashboard(props) {
  const [stocks] = useHttpGet(`http://localhost:5000/api/userStocks/${props.username}`, [], "Got user's stocks");
  
  
  
  return(
    <div >
      <Navbar/>
      <p onLoad = {reload}>{props.username}</p>
      {props.stocks.map(stock => (
        <p>{stock.name}, {stock.price_bought_at}, {stock.price_now}</p>

      ))}
    </div>

  );
}

export default Dashboard;
